from random import randint
from typing import List
from pprint import pprint


class Solution:

    def maxDistance(self, grid: List[List[int]]) -> int:
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if grid[i][j] == 0:
                    self.dfs(grid, i, j, [(i, j)])
        # print(grid)
        return max([dis for line in grid for dis in line]) - 1

    def dfs(self, grid, x, y, path=[]):
        # if x == 88 and y == 99:
        #     breakpoint()
        if grid[x][y] == 1:
            return 0
        directions = [(0, -1), (-1, 0), (0, 1), (1, 0)]
        next_dis = 10 ** 6
        for step_x, step_y in directions:
            next_x = x + step_x
            next_y = y + step_y
            if 0 <= next_x < len(grid) and 0 <= next_y < len(grid[0]):
                if (next_x, next_y) not in path:
                    if grid[next_x][next_y] != 0:
                        next_dis = min(next_dis, grid[next_x][next_y])
                    else:
                        next_dis = min(next_dis, self.dfs(grid, next_x, next_y, path + [(next_x, next_y)]))
        # print(x, y, next_dis)
        if next_dis != 10 ** 6:
            if grid[x][y] == 0:
                grid[x][y] = next_dis + 1
            else:
                grid[x][y] = min(grid[x][y], next_dis + 1)
        return grid[x][y]


